import React from "react";
import DrawPopup from "./DrawPopup";
import { useState } from "react";
import FeatureTable from "./FeatureTable";
import { logout } from '../services/authService';
import { useNavigate } from 'react-router-dom';
import { useSelector } from "react-redux";

const Navbar = () => {
  const [showPopup, setShowPopup] = useState(false);
  const [showTable, setShowTable] = useState(false);
  const navigate = useNavigate();
  const isAdmin = useSelector((state) =>state.admin.isAdmin);
  

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div className="navbar bg-gray-800 text-white p-4 flex items-center justify-center space-x-4">
      <button
        className="rounded-md border border-transparent px-4 py-2 bg-blue-600 text-base leading-6 font-medium text-white shadow-sm hover:bg-blue-500 focus:outline-none focus:shadow-outline-blue transition ease-in-out duration-150 sm:text-sm sm:leading-5"
        onClick={() => {
          setShowPopup(true);
        }}
      >
        Add Feature
      </button>
      <button
        className="rounded-md border border-transparent px-4 py-2 bg-blue-600 text-base leading-6 font-medium text-white shadow-sm hover:bg-blue-500 focus:outline-none focus:shadow-outline-blue transition ease-in-out duration-150 sm:text-sm sm:leading-5"
        onClick={() => {
          setShowTable(true);
        }}
      >
        Query
      </button>
      {isAdmin && (
        <button
          className="rounded-md border border-transparent px-4 py-2 bg-green-600 text-base leading-6 font-medium text-white shadow-sm hover:bg-green-500 focus:outline-none focus:shadow-outline-green transition ease-in-out duration-150 sm:text-sm sm:leading-5"
          onClick={() => navigate("/admin")}
        >
          Admin Page
        </button>
      )}
      <button
        className="ml-auto rounded-md border border-transparent px-4 py-2 bg-red-600 text-base leading-6 font-medium text-white shadow-sm hover:bg-red-500 focus:outline-none focus:shadow-outline-red transition ease-in-out duration-150 sm:text-sm sm:leading-5"
        onClick={handleLogout}
      >
        Logout
      </button>
      {showPopup && <DrawPopup onClose={() => setShowPopup(false)} />}
      {showTable && <FeatureTable onClose={() => setShowTable(false)} />}
    </div>
  );
};

export default Navbar;
